@Jade It's a custom modified car from 1986. It doesn't have to pass any emissions norms, at least not in Europe and not newer than 1986. 
Some countries also have special regulations about cars modified for motorsport which allow them to be street legal and ignore most rules normal cars have to meet.
I might add that passing norms in modified car is actually easy even when they're new. You're just using different ECU map for test and different for full performance. Some ECUs can remember many maps and switch them in real time, so you don't even have to bother swapping ECUs or reprogramming them. Just push a button on the dashboard to choose low power/ecological map.

